import React from 'react';
import './App.css';


//a5o4wu2Ghgnehh_kX79193wPTv9bD4A72hY5mtzv
function App():JSX.Element {

    function getResult():Promise<JSON> {

        return( fetch("https://api.wheretheiss.at/v1/satellites/25544")

            .then((data:any)=>data.json())
            .catch(error => console.log('error', error))
              );

    }
    function show(s:Promise<String>):JSX.Element {


        return(<div >

            {s}
            </div>)


    }




    return (
        <div className="App">
            Here we go:

            <div >
        {show(getResult().then((promise)=>JSON.stringify(promise)))}
            </div> 


        </div>
    );
}

export default App;
